import React from "react";
import NavDropdown from "react-bootstrap/NavDropdown";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row"
import Container from "react-bootstrap/esm/Container";


const DropdownItemFlavor = (props) => {
    return (
        <Col lg="2" md="4" sm="6">
            {/* <Container> */}
            <NavDropdown.Item href={"/"+props.name}>

                <div style={{textAlign:"center", display:"block", inlineSize:"min-content"}}>
                <img className="flavor-image" src={"../images/"+props.img}/>
                {props.name}    

                </div>
            </NavDropdown.Item>

            {/* </Container> */}
        </Col>
    );
};


export default DropdownItemFlavor;
